import { Image, Slider } from "antd";
import React from "react";

const SliderComponent = ({ arrImages }) => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <div>
      <Slider settings={settings}>
        {arrImages.map((image) => {
          return (
            <Image src={image} alt="slider" preview={false} width="100%" />
          );
        })}
      </Slider>
    </div>
  );
};

export default SliderComponent;
